import "./messages.css";
function MsgHeader() {
  return (
    <div>
      <div className="Wrapper">
        <img className="connectedUserImageHeader" src="images/miki.png" alt="" />
        <div className="Wrap">
        <div className="connectedNameHeader">malek guedda</div>
        <div className="stateHeader">
              Actuellement en ligne
        </div>
        </div>
      </div>
    </div>
  );
}
export default MsgHeader;
